import React, { Component } from 'react';
import {View, Text, StyleSheet ,Image, TouchableOpacity } from 'react-native';
export default class ViewPoint extends Component {
  render() {
    return (
      <View style={styles.container}>
        <View style={styles.leftContainer}>
          <Image style={{ resizeMode: 'cover', width: '252px', height: '70px',marginBottom: 28 }}source={require('../../assets/img/logo.svg')} />
          <Text style={styles.heading}>ELECTION OK21</Text>
          <TouchableOpacity>
            <View style={styles.btn}>
              <Text style={{fontSize: '30px'}}>Vote with</Text>
              <Image style={{width: '56px', height: '12px', resizeMode: 'cover'}} source={require('../../assets/img/nem.svg')} />
            </View>
            </TouchableOpacity>
        </View>
        <View style={styles.rightContainer}>
          <Text>lorem10</Text>
        </View>
      </View>
    )
  }
}

const styles = StyleSheet.create({
  container: {
    width: '1260px',
    display: 'flex',
    flexDirection: 'row',
    minHeight: 350,
    justifyContent: 'center'
  },
  leftContainer: {
    width: '35%',
    padding: '60px',
    backgroundColor: 'rgba(255,255,255,0.75)',
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
  },
  rightContainer: {
    flex: 1,
    width: '65%',
    backgroundColor: 'rgba(0,117,163,0.75)',
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
  },
  heading: {
    textTransform: 'uppercase',
    fontWeight: 700,
    fontSize: '32px',
    color: '#0075A3',
    marginBottom: 15
  },
  btn: {
    display: 'flex',
    flexDirection: 'row',
    width: '200px',
    height: '40px',
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: 'black',
  }
})
